import React, { useState, useEffect } from "react";

function ContainerEntryForm() {
  const [formData, setFormData] = useState({
    consignee: "",
    poNo: "",
    supplier: "",
    material: "",
    arrivalDate: "",
    arrivalTime: "",
    docs: "",
    tax: "",
    type: "",
    containerNo: "",
    inBound: "",
    emptyDate: "",
    outBound: "",
    unloadedAtDock: "",
    emptyAt: "",
    personalNote: "",
  });

  const [images, setImages] = useState([]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleImageChange = (e) => {
    const files = Array.from(e.target.files);
    const imagePreviews = files.map((file) => ({
      file,
      preview: URL.createObjectURL(file),
    }));
    setImages(imagePreviews);
  };

  useEffect(() => {
    return () => {
      images.forEach((img) => URL.revokeObjectURL(img.preview));
    };
  }, [images]);

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData);
    console.log(images);
    // TODO: Add your submit logic here
  };

  return (
    <div className="max-w-7xl mx-auto p-4 bg-white rounded shadow">
      <form onSubmit={handleSubmit} className="grid grid-cols-3 gap-4">
        {[
          ["Consignee", "consignee", "select"],
          ["PO No", "poNo", "text"],
          ["Supplier", "supplier", "select"],
          ["Material", "material", "textarea"],
          ["Arrival Date", "arrivalDate", "date"],
          ["Arrival Time", "arrivalTime", "time"],
          ["Docs", "docs", "select"],
          ["Tax", "tax", "text"],
          ["Type", "type", "select"],
          ["Container No", "containerNo", "text"],
          ["In Bound", "inBound", "select"],
          ["Empty Date", "emptyDate", "date"],
          ["Out Bound", "outBound", "select"],
          ["Unloaded @ Dock", "unloadedAtDock", "select"],
          ["Empty At", "emptyAt", "text"],
        ].map(([label, name, type]) => (
          <div key={name}>
            <label className="block text-sm font-medium mb-1">{label}</label>
            {type === "textarea" ? (
              <textarea
                name={name}
                value={formData[name]}
                onChange={handleChange}
                className="w-full p-1 border rounded"
                rows={3}
              />
            ) : type === "select" ? (
              <select
                name={name}
                value={formData[name]}
                onChange={handleChange}
                className="w-full p-1 border rounded"
              >
                <option value="">Select</option>
                <option value="Option1">Option 1</option>
                <option value="Option2">Option 2</option>
              </select>
            ) : (
              <input
                type={type}
                name={name}
                value={formData[name]}
                onChange={handleChange}
                className="w-full p-1 border rounded"
              />
            )}
          </div>
        ))}

        {/* Image Upload */}
        <div className="col-span-3">
          <label className="block text-sm font-medium mb-1">Upload Images</label>
          <input
            type="file"
            multiple
            accept="image/*"
            onChange={handleImageChange}
            className="w-full p-1 border rounded"
          />
          {images.length > 0 && (
            <div className="mt-2 grid grid-cols-4 gap-2">
              {images.map((img, index) => (
                <img
                  key={index}
                  src={img.preview}
                  alt={`preview-${index}`}
                  className="w-full h-24 object-cover rounded border"
                />
              ))}
            </div>
          )}
        </div>

        {/* Personal Note */}
        <div className="col-span-3">
          <label className="block text-sm font-medium mb-1">Personal Note</label>
          <textarea
            name="personalNote"
            value={formData.personalNote}
            onChange={handleChange}
            className="w-full p-2 border rounded"
            rows={2}
          />
        </div>

        <div className="col-span-3">
          <button
            type="submit"
            className="bg-blue-600 text-white py-2 px-4 rounded w-full"
          >
            Submit
          </button>
        </div>
      </form>
    </div>
  );
}

export default ContainerEntryForm;
